import React from "react";
import { useGallary } from "../../context/gallaryContext";

const PhotoList = () => {
  const { photos } = useGallary();
  console.log(photos);
  return (
    <div className="px-5 py-10">
      <div className="grid grid-cols-4 gap-5"></div>
    </div>
  );
};

export default PhotoList;
